import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const PropertyManagementPage = () => {
    const [formData, setFormData] = useState({
        user_id: '', 
        image_url: '',
        title: '',
        description: '',
        address: '',
        city: '',
        state: '',
        zip_code: '',
    });

    const [newListing, setNewListing] = useState(null);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const addUserToFormData = { ...formData, user_id: localStorage.id };
        const response = await fetch('http://127.0.0.1:5000/listings', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(addUserToFormData),
        });

        if (response.ok) {
            // Fetch and set the newly created listing
            const newListingData = await response.json();
            setNewListing(newListingData);
        }
    };

    return (
        <div>
            <h2>Property Management</h2>
            <form onSubmit={handleSubmit}>
                {/* Form input fields go here... */}
                <button type="submit">Submit Listing</button>
            </form>
            {newListing && (
                <div>
                    <h3>Newly Created Listing</h3>
                    <p>Title: {newListing.title}</p>
                    <p>Description: {newListing.description}</p>
                    {/* Display other listing details as needed */}
                </div>
            )}
            <div>
                <Link to="/dashboard">
                    <button>Dashboard</button>
                </Link>
            </div>
        </div>
    );
};

export default PropertyManagementPage;
